package cn.cenjp.platform.vo;import cn.cenjp.platform.bean.User;public class SearchUser {    private String code;    private User user;    private Integer status;    public SearchUser(String code, User user, Integer status) {        this.code = code;        this.user = user;        this.status = status;    }    public SearchUser() {    }    public String getCode() {        return code;    }    public void setCode(String code) {        this.code = code;    }    public User getUser() {        return user;    }    public void setUser(User user) {        this.user = user;    }    public Integer getStatus() {        return status;    }    public void setStatus(Integer status) {        this.status = status;    }    @Override    public String toString() {        return "SearchUser{" +                "code='" + code + '\'' +                ", user=" + user +                ", status=" + status +                '}';    }}